import React from 'react';
import styled from 'styled-components';

const Footer = () => {

    return (
            <FooterStyled>
                <div className='nested-wrapper'>
                    My Footer
                </div></FooterStyled>
    )
}
export default Footer;


const FooterStyled = styled.footer`
background-color: teal;
padding: 20px;

        @media ${mg.tablet} {
            width: 100px;
            line-height: 50px;
            margin: 0px 10px 0px 10px;

        @media ${mg.desktop} {
            width: 150px;
        }

`;
